import { FormControl, FormLabel, VStack, Input } from "@chakra-ui/react";
import React from "react";

const Signup = () => {
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel>
          <Input />
        </FormLabel>
      </FormControl>
    </VStack>
  );
};

export default Signup;
